def _generate_mods(self, mods):
    """ID: 8ff5a1ff-e5c5-41df-a304-ec6ada62089f"""
    res = {}
    for mod, node in mods.items():
        res[mod] = {
            "filename": os.path.relpath(node.get_filename(), self.package)
            if node.get_filename()
            else None,
            "methods": node.get_methods(),
        }
